from typing import List

def adi_part5(
    n: int,
    X: List[List[int]],
    A: List[List[int]],
    B: List[List[int]]
) -> List[List[int]]:
    return matrix_row_slice(
        matrix_elemwise_sub(
            X,
            matrix_elemwise_div(
                matrix_elemwise_mul(
                    matrix_row_slice(X, 0, n - 1),
                    matrix_row_slice(A, 1, n)
                ),
                matrix_row_slice(B, 0, n - 1)
            )
        ),
        1,
        n
    )
